import React, { Fragment, useState } from "react";
import img from "../../Image/image.jpg";
import google from "../../Image/google.svg";
import { AdapterDayjs } from "@mui/x-date-pickers/AdapterDayjs";
import { LocalizationProvider } from "@mui/x-date-pickers/LocalizationProvider";
import { DatePicker } from "@mui/x-date-pickers/DatePicker";
import BackTo from "../Common/Button/BackTo";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import useApiUser from "../Hook/useCreateApi";
import { CircularProgress } from "@mui/material";

const Sign = () => {
  const [formData, setFormData] = useState({
    email: "",
    name: "",
    birthDate: {},
    address: "",
    phone: "",
    password: "",
  });

  const { isLoading, postData } = useApiUser(
    "http://localhost:8000/api/createUser"
  );

  const handleDateChange = (newValue) => {
    setFormData((prev) => ({ ...prev, birthDate: newValue }));
  };

  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async () => {
    try {
      await postData(formData);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <Fragment>
      <div className="flex items-center justify-center min-h-screen bg-gray-100">
        <div className="relative flex flex-col m-6 space-y-8 bg-white shadow-2xl rounded-2xl md:flex-row md:space-y-0">
          <div className="flex flex-col justify-center p-8 md:p-10">
            <BackTo toLink={"/login"} sx={"w-[90px]"}>
              Back
            </BackTo>
            <div className="lg:w-[500px] lg:flex inline pb-1">
              <p className="font-bold duration-700 sm:text-4xl text-3xl sm:mr-3">
                Create account
              </p>
            </div>
            <span className="font-light text-gray-400 mb-5">
              Welcom back! Please enter your details
            </span>
            <Box
              component="form"
              sx={{
                flex: 1,
                "& .MuiTextField-root": { my: 2 },
                "& .MuiInputBase-input": {
                  //   padding: "9px",
                  color: "#333",
                },
                "& .MuiFormControl-root": {
                  display: "flex",
                  justifyItems: "center",
                  justifyContent: "center",
                },
              }}
              // noValidate
              autoComplete="off"
            >
              <TextField
                size="small"
                required
                error={!formData.email.trim()}
                name="email"
                id="email"
                label="Email"
                value={formData.email}
                onChange={handleChange}
              />
              <TextField
                size="small"
                required
                name="name"
                id="name"
                label="Name"
                value={formData.name}
                onChange={handleChange}
              />
              <LocalizationProvider dateAdapter={AdapterDayjs}>
                <DatePicker
                  // value={formData.birthDate}
                  //   label="DATE"
                  size="small"
                  onChange={handleDateChange}
                  sx={{
                    "& .MuiInputBase-input": {
                      padding: "9px",
                      color: "#333",
                    },
                    flex: 1,
                  }}
                />
              </LocalizationProvider>

              <TextField
                size="small"
                required
                name="address"
                id="address"
                label="Address"
                value={formData.address}
                onChange={handleChange}
              />

              <TextField
                size="small"
                required
                name="phone"
                id="phone"
                label="Phone"
                value={formData.phone}
                onChange={handleChange}
              />

              <TextField
                size="small"
                required
                name="password"
                id="password"
                type="password"
                label="Password"
                value={formData.password}
                onChange={handleChange}
              />
            </Box>
            <button
              onClick={handleSubmit}
              className="w-full scale-105 transition-all duration-300 bg-black text-white p-2 rounded-lg mb-6 hover:bg-white hover:text-black border hover:border-gray-300"
            >
              {isLoading ? (
                <CircularProgress
                  color="inherit"
                  sx={{
                    width: "19px !important",
                    height: "19px !important",
                  }}
                />
              ) : (
                "Create"
              )}
            </button>
            <button className="w-full border scale-105 transition-all duration-300 border-gray-300 text-md p-2 rounded-lg mb-6 hover:bg-black hover:text-white">
              <img src={google} alt="img" className="w-6 h-6 inline mr-2" />
              Create with Google
            </button>
          </div>
          <div className="relative">
            <img
              src={img}
              alt={img}
              className="w-[400px] h-full hidden rounded-r-2xl md:block object-cover"
            />
            <div className="absolute hidden bottom-10 right-6 p-6 bg-violet-300 bg-opacity-30 backdrop-blur-sm rounded drop-shadow-lg md:block">
              <span className="text-white text-xl">
                We've been uesing Untitle to kick"
                <br />
                start every new project and can't <br />
                imagine working without it."
              </span>
            </div>
          </div>
        </div>
      </div>
    </Fragment>
  );
};

export default Sign;
